import React from 'react'

function slectmultiplecheckboxes() {






const multiplecheck=[
    {id:1,city:"Karachi"},
    {id:2,city:"Islamabad"},
    {id:3,city:"Lahore"},
    {id:4,city:"Rawalpindi"},
    {id:5,city:"Peshawar"},
    {id:6,city:"Faisalabad"},
    {id:7,city:"Multan"},
]


    return (
        <div>
            <div >
            <label for="allslect">All Select Boxes</label>
           <input type="checkbox" id="allslect" name="allselectbox" />
            </div>

            <br/>
         
                {
                    multiplecheck.map((row,index)=>{
                        return  <div>
                                <label for="row.city">{row.city}</label>
                                <input type="checkbox" id="row.city" name="row.city" />
                                </div>
                  
                              
                        
                    })
                }
            </div>
  
    )
}

export default slectmultiplecheckboxes
